import React from 'react';
import './index.css'
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';


const App = () => {
  addNote

  return (
    <>
      <Header />
      <CreateNote
        passNote = {addNote}
       />
      <Note />
      <Footer />
    </>
  )
}
export default App;
